# -*- coding: utf-8 -*-
# GUI g-portal logs downloader for scum servers
# by GAMEBOTLAND.com

import json
import asyncio
from bs4 import BeautifulSoup
import cfscrape
from configparser import RawConfigParser
from datetime import datetime
import queue
import PySimpleGUI as sg
import time
import webbrowser


def log(text):
    print('[%s] %s' % (datetime.strftime(datetime.now(), '%H:%M:%S'), text))


def help():
    print('\nPlease complete your g-portal credentials or edit scumlogs.ini,\nuse:')
    print('  user = your gportal email  or username')
    print('  password = your gportal password')
    print('  serverid = gportal server id')
    print('  loc = com (for gportal international) or us (for gportal us)')
    print('  folder = blank for local or path folder to store your log files')
    print('  leave the rest of the parameters as is\n')


def load_configini():
    config = RawConfigParser()
    with open('scumlogs.ini', 'r', encoding="utf-8") as f:
        config.read_file(f)
    global configini
    configini = dict(config['GPORTAL'])


def save_configini():
    parser = RawConfigParser()
    parser.add_section('GPORTAL')
    for key in configini.keys():
        parser.set('GPORTAL', key, configini[key])
    with open('scumlogs.ini', 'w', encoding="utf-8") as f:
        parser.write(f)


async def read_logs(gui_queue):
    if configini['loc'] == 'com':
        loc = 'eur'
        URL_LOGIN = 'https://id2.g-portal.com/login?redirect=https://www.g-portal.com/:regionPrefix/auth/login?redirectAfterLogin=%2F&defaultRegion=EU'
    else:
        loc = 'int'
        URL_LOGIN = 'https://id2.g-portal.com/login?redirect=https://www.g-portal.com/:regionPrefix/auth/login?redirectAfterLogin=%2F&defaultRegion=US'
    URL_LOGS = 'https://www.g-portal.com/{0}/server/scum/{1}/logs'.format(loc, configini['serverid'])
    headers = {'User-Agent': 'Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko)'}
    with cfscrape.create_scraper() as session:
        try:
            log('connecting g-portal...')
            payload = {'_method': 'POST', 'login': configini['user'], 'password': configini['password'],
                       'rememberme': '1'}
            raw_response = session.post(URL_LOGIN, headers=headers, data=payload)
            raw_response = session.get(URL_LOGS, headers=headers)
            response = raw_response.text
            html = BeautifulSoup(response, 'html.parser')
            select = html.find('div', {'class': 'wrapper logs'})
            loglist = select['data-logs']
            logs = json.loads(loglist)

            for i in range(len(logs)):
                getid = logs["file_" + str(i + 1)]
                id = (getid[int(getid.find('Logs')) + 5:])
                type = id.split('_')[0]

                if configini[type + '_file'] != '':
                    if id < configini[type + '_file']:
                        continue
                payload = {'_method': 'POST', 'load': 'true', 'ExtConfig[config]': getid}
                raw_response = session.post(URL_LOGS, headers=headers, data=payload)
                response = raw_response.text
                content = json.loads(response)
                lines = content["ExtConfig"]["content"].splitlines()
                filename = configini['folder'] + id
                file = open(filename, "a+", encoding='utf-8')
                found = False
                writing = False
                for line in lines:
                    if id == configini[type + '_file'] and not found:
                        if line == configini[type + '_line']:
                            found = True
                            continue
                    else:
                        file.write(line + '\n')
                        writing = True
                if writing:
                    if found:
                        log('updating {}'.format(id))
                    else:
                        log('creating {}'.format(id))
                file.close()
                configini[type + '_file'] = id
                configini[type + '_line'] = lines[-1]
            save_configini()
        except:
            log('error connecting, check connectivity and credentials')
            help()

    gui_queue.put('finished...')

async def the_gui():
    global configini
    global URL_LOGIN
    global URL_LOGS

    sg.ChangeLookAndFeel('Dark')
    sg.SetOptions(element_padding=(0, 0))
    gui_queue = queue.Queue()
    layout = [[sg.Text("GAMEBOTLAND scumlogs v1.0")],
              [sg.Image(
                  data='',
                  size=(455, 100), pad=((0, 0), (0, 0)))],
              [sg.Text("scum server logs downloader from G-Portal")],
              [sg.Frame(layout=[
                  [sg.Text('Username', size=(8, 1), justification='left'), sg.InputText('', size=(30, 1), key='user')],
                  [sg.Text('Password', size=(8, 1), justification='left'),
                   sg.InputText('', size=(30, 1), password_char='*', key='password')],
                  [sg.Text('Server id', size=(8, 1), justification='left'),
                   sg.InputText('', size=(8, 1), key='serverid')],
                  [sg.Text('Folder', size=(8, 1), justification='left'), sg.InputText('', size=(40, 1), key='folder'),
                   sg.FolderBrowse()],

                  [sg.Radio('G-Portal international', "RADIO1", default=True, key='com', size=(18, 1)),
                   sg.Radio('G-Portal us', "RADIO1", key='us')]
              ], title='G-Portal server info', size=(200, 100))],
              [sg.Output(size=(62, 20), pad=((0, 0), (2, 0)), font='Sans 10')],
              [sg.Button('Start', size=(15, 1), bind_return_key=True, focus=True),
               sg.SimpleButton('Exit', size=(15, 1), button_color=('white', 'firebrick3')),
               sg.Text("GAMEBOTLAND.com", justification='right', click_submits='GAMEBotLand.com')]]

    window = sg.Window('GAMEBOTLAND scumlogs v1.0', layout,
                       auto_size_text=False,
                       auto_size_buttons=False,
                       no_titlebar=True,
                       grab_anywhere=True,
                       size=(500, 650))

    values = (
    'user', 'password', 'serverid', 'loc', 'folder', 'admin_file', 'admin_line', 'chat_file', 'chat_line', 'kill_file',
    'kill_line', 'login_file', 'login_line', 'violations_file', 'violations_line')
    try:
        load_configini()
    except:
        configini = {}
    for value in values:
        if value not in configini:
            configini[value] = ''
    save_configini()
    start = True
    while True:
        event, values = window.Read(timeout=10)
        if start:
            if configini['loc'] == 'com':
                window.FindElement('com').Update(True)
            else:
                window.FindElement('us').Update(True)
            window.FindElement('user').Update(configini['user'])
            window.FindElement('password').Update(configini['password'])
            window.FindElement('serverid').Update(configini['serverid'])
            window.FindElement('folder').Update(configini['folder'])
            start = False
        if event is None or event == 'Exit':
            break
        elif event == 'Start':
            try:
                print('started...')
                configini['user'] = values['user']
                configini['password'] = values['password']
                configini['serverid'] = values['serverid']
                configini['folder'] = values['folder']
                if configini['folder'] != '':
                    if configini['folder'][-1:] != '/' and configini['folder'][-1:] != '\\':
                        configini['folder'] = configini['folder'] + '/'
                if values['com']:
                    configini['loc'] = 'com'
                else:
                    configini['loc'] = 'us'
                asyncio.create_task(read_logs(gui_queue))
            except Exception as e:
                print('error detected...')
        elif event == 'GAMEBOTLAND.com':
            webbrowser.open('https://gamebotland.com')
        try:
            message = gui_queue.get_nowait()
        except queue.Empty:
            message = None
        if message:
            print(message)
        await asyncio.sleep(0.01)
    window.Close()

if __name__ == '__main__':
    loop = asyncio.get_event_loop()
    loop.run_until_complete(the_gui())
    loop.close()

